@import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,200;0,300;0,400;0,500;1,200;1,300;1,400;1,500&display=swap');

*,
*::after,
*::before {
    box-sizing: border-box;
    padding: 0;
    margin: 0;
    text-decoration: none;
    list-style: none;
    scroll-behavior: smooth;
}

html {
    scroll-behavior: smooth;
  }

  
 .logo img {
    height: 100px; 
    margin-left: 10px; 
    font-size: 24px;
    margin-top: 30px
  }
  
  .logo {
    display: flex;
    align-items: center;
    font-size: 30px !important; /* Use !important to override other styles if necessary */
    line-height: 1.2; /* Adjust the line height as needed */
}
 
  

body {
    font-family: 'Poppins', sans-serif;
    overflow-x: hidden;
}

/* customizing scrollbar  */

::-webkit-scrollbar {
    width: 0.4rem;
}

/* Track */
::-webkit-scrollbar-track {
    background: #ffe77b;
}

/* Handle */
::-webkit-scrollbar-thumb {
    background: #fdc0ff;
}

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
    background: #00d9ff;
}

/* utility class */
.btn {
    background-color: #ff2828c9;
    padding: 10px 30px;
    border: none;
    border-radius: 20px;
    color: white;
    font-weight: 300;
    font-size: 1rem;
    cursor: pointer;
}

.btn:hover {
    background-color: #ff0000;
    transition: background-color 300ms ease-in-out;
}

.highlight {
    color: #ff4646;
}

.text-gray {
    color: #525252;
}

.container {
    width: 1024px;
    display: flex;
    align-items: center;
}

.header {
    background: url('bg.jpg');
    background-size: cover;
    min-height: 100vh;
    width: 100%;
}

.navbar input[type="checkbox"],
.navbar .hamburger-lines {
    display: none;
}

.navbar {
    width: 100%;
}

.navbar-container {
    display: flex;
    justify-content: space-between;
    height: 5rem;
    align-items: center;
    padding: 0 1rem;
    color: white;
}

.logo {
    cursor: pointer;
    color: red;
    letter-spacing: 5px;
    text-shadow: 2px 1px #ffffff, 2px 1px #ffffff;
}

.menu-items {
    display: flex;
    align-items: center;
}

.menu-items li {
    margin: 0 0.5rem;
    padding: 0 0.5rem;
    border-radius: 20px;
}

.menu-items li:hover {
    transform: scale(1.1);
    background-color: rgb(0, 0, 0);
    transition: all 300ms ease-in-out;
}

.menu-items li a {
    font-size: 1rem;
    font-weight: 500;
    color: white;
}

.menu-items li a:hover {
    color: rgb(255, 0, 0);
    transition: color 300ms ease-in-out;
}


/* home  */
.home-container {
    /* width: 100vw; */
    min-height: 100vh;
    display: flex;
    justify-content: center;
    align-items: start;
}

.home {
    /* width: 100%; */
    color: rgb(255, 255, 255);
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    gap: 2rem;
    padding-top: 3rem;
}

.home h1 {
    font-size: 4rem;
}

.home p {
    text-align: center;
    text-shadow: 3px 2px 20px #000000, 3px 2px 20px #000000;
    padding: 0 5rem;
}

.food-container {
    width: 100%;
    background: #ffdec0;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.food {
    display: flex;
    justify-content: space-between;
    width: 1024px;
    padding: 3rem 1rem;
    gap: 1rem;
}

.menu {
    width: 320px;
}

.menu h1 {
    font-size: 2rem;
    font-weight: 400;
}

.menu ul {
    padding: 2rem 0;
}

.menu ul li {
    margin: 5px 0;
    padding: 8px 20px;
    font-size: 1.5rem;
    background-color: white;
    color: #ff4646;
    border-radius: 50px;
}

.food-item-container {
    width: 704px;
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 1rem;
}

.food-item {
    width: 100%;
}

.image-wrapper {
    overflow: hidden;
    border-radius: 20px;
    height: 250px;
}

.image-wrapper img {
    position: inherit;
    width: 100%;
    border-radius: 20px;
    height: 100%;
}

.image-wrapper img:hover {
    transform: scale(1.1);
    transition: transform 0.5s ease-in-out;
    cursor: pointer;
}

.food-item h4 {
    letter-spacing: 2px;
}

/* dessert  */
.dessert-container {
    width: 100%;
    background: #fdc0ff;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.dessert {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 2rem 0;
}

.dessert h1 {
    font-size: 2rem;
    font-weight: 400;
}

.dessert-grid {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-gap: 1rem;
    margin-top: 1rem;
    padding: 0 10px;
}

.dessert-item {
    display: flex;
    justify-content: space-between;
    align-items: center;
    gap: 1rem;
    border: 1px solid white;
    padding: 0.5rem 1rem;
    border-radius: 10px;
    cursor: pointer;
}

.dessert-item:hover {
    background-color: white;
    transition: background-color 0.5s ease-in-out;
}



/* gallery  */
.gallery-container {
    width: 100%;
    background: #ffe77b;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}

.gallery {
    width: 1024px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 2rem 1rem;
    gap: 0.5rem;
}

.gallery h1 {
    font-size: 2rem;
    font-weight: 400;
}

.gallery-grid {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-gap: 1rem;
    padding: 1rem 0;
}

.gallery-item {
    width: 100%;
    height: 250px;
    border-radius: 20px;
    overflow: hidden;
}

.gallery-item img {
    height: 100%;
    width: 100%;
    border-radius: 20px;
    cursor: pointer;
}

.gallery-item img:hover {
    transform: scale(1.1);
    transition: all 0.5s ease-in-out;



    
}


/* Testimonials Section*/

.testimonials {
    padding: 50px 0;
    text-align: center;
    background-color: #070e16;
    color: #fff;
  }
  
  .testimonials h2 {
    font-size: 30px;
    margin-bottom: 40px;
  }
  
  .testimonial {
    max-width: 800px;
    margin: 0 auto 60px;
    text-align: left;
  }
  
  .testimonial img {
    display: block;
    width: 120px;
    height: 120px;
    border-radius: 50%;
    margin: 0 auto 20px;
  }
  
  .testimonial p {
    font-size: 20px;
    margin-bottom: 30px;
  }
  
  .testimonial h4 {
    font-size: 24px;
    font-weight: bold;
  }
  

/* footer  */
.footer {
    background: linear-gradient(105deg, #747474, rgb(54, 54, 54));
    padding-top: 80px;
    padding-bottom: 40px;
}

.row {
    display: flex;
    align-items: center;
    justify-content: space-around;
}

.col {
    max-width: 320px;
    padding: 1rem 10px;
}

.footer-content {
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-bottom: 40px;
  }
  
  .footer-logo img {
    max-width: 150px;
  }
  
  .footer-links a {
    color: #fff;
    margin: 0 10px;
    text-decoration: none;
  }
  
  .footer-social a {
    color: #fff;
    margin: 0 5px;
    text-decoration: none;
  }
  
  .footer-text {
    font-size: 14px;
  }






button {
    padding: 0;
    border: none;
    background-color: transparent;
    -webkit-border-radius: 0;
    border-radius: 0;
}

.social_profile {
    margin-top: 40px;
}

.social_profile ul {
    list-style: outside none none;
    margin: 0;
    padding: 0;
}



.footer-content {
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-bottom: 40px;
  }
  
  .footer-logo img {
    max-width: 150px;
  }
  
  .footer-links a {
    color: #fff;
    margin: 0 10px;
    text-decoration: none;
  }
  
  .footer-social a {
    color: #fff;
    margin: 0 5px;
    text-decoration: none;
  }
  
  .footer-text {
    font-size: 14px;
  }

  /* reservations*/

.reservations {
    background-color: #411111;
    padding: 50px 0;
    text-align: center;
    color: #ffffff;
  }
  
  .reservation-form {
    max-width: 600px; 
    margin: 0 auto;
    background-color: #333;
    padding: 40px; 
    border-radius: 15px; 
    box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
  }
  
  .reservation-form h2 {
    color: #ff9f00;
    font-size: 36px; 
    margin-bottom: 30px; 
  }
  
  .reservation-form form .input-group {
    display: flex;
    justify-content: space-between;
    margin-bottom: 30px; 
  }
  
  .reservation-form form input,
  .reservation-form form textarea {
    flex: 1;
    padding: 15px; 
    border-radius: 8px; 
    border: 2px solid #555;
    font-size: 18px; 
    color: #333;
    background-color: #ddd;
    transition: border-color 0.3s ease;
  }
  
  .reservation-form form input:focus,
  .reservation-form form textarea:focus {
    border-color: #ff9f00;
    background-color: #fff;
    color: #111;
  }
  
  .reservation-form form button {
    display: block;
    background-color: #ff9f00;
    color: #fff;
    padding: 20px 30px; 
    border: none;
    border-radius: 8px;
    text-decoration: none;
    font-weight: bold;
    transition: background-color 0.3s ease;
    cursor: pointer;
  }
  
  .reservation-form form button:hover {
    background-color: #ff7f00;
  }

 /* Contact Section*/
.contact {
    background-color: #333;
    padding: 80px 0; 
    text-align: center;
    color: #fff;
}

.contact-container {
    max-width: 500px; 
    margin: 0 auto;
}

.contact h2 {
    font-size: 32px; 
    margin-bottom: 40px; 
}

.contact-info {
    display: flex;
    justify-content: center;
    margin-bottom: 30px; 
  }

.info-item {
    margin: 0 20px; 
}

.info-item i {
    font-size: 24px; 
    margin-bottom: 30px; 
}



.contact-form input,
.contact-form textarea {
    display: block;
    width: 100%;
    padding: 10px;
    margin-bottom: 20px; 
    border-radius: 5px; 
    border: none;
    font-size: 18px; 
}

.contact-form textarea {
    resize: vertical;
}

.contact-form button {
    display: inline-block;
    background-color: #ff0000;
    color: #fff;
    padding: 10px 40px; 
    border-radius: 5px; 
    text-decoration: none;
    font-weight: bold;
    font-size: 24px; 
    transition: background-color 0.3s ease;
    cursor: pointer;
}
